import React from 'react'


class Star extends React.Component {

    render(){
        console.log(this.props.star.className)

        return (
            <div className={this.props.star.className} style={{
                width: this.props.star.size,
                height: this.props.star.size}}
            >
            </div>
        )

    }
}

export default Star
